import ExpenseItem from "./Expenses";
import "./ExpenseList.css";

const ExpenseList = props => {
    
    console.log(props);


  return (
    <ul className="lxpense-list">
    {props.items.map((expenses)=>(
        <ExpenseItem
        key={expenses.id}
        title={expenses.title}
        date={expenses.date}
        amount={expenses.amount}
    />
  ))}
   </ul>

    );

}

export default ExpenseList;
